import React from 'react';

const Todo = () => {
  const storedUser = JSON.parse(localStorage.getItem('user'));

  return (
    <div>
      {storedUser?.name ? (
        <h2>Welcome, {storedUser.name}!</h2>
      ) : (
        <h2>User not found. Please login again.</h2>
      )}
    </div>
  );
};

export default Todo;
